import React from "react";

const Home = () => {
  return (
    <div name="home" className="">
      {/* Container */}
      <div className="">
        <h1 className="">Welcome to</h1>
        <h2 className="">Party Foul!</h2>
        <p className="">Where the party comes to you!!</p>
        <div>
          <button className="">
            Let's Party!!
            <span className=""></span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
